import ReactDOM from "react-dom";
import "./index.css"

const Runmachine = () => {

  let x = ['üòÑ', 'üò∏', 'üòÉ', 'üòÖ', 'ü•∞', 'üòà', '‚ò†Ô∏è', 'üëæ', 'üò≤', 'üòõ', 'üôÅ', 'üòú']
  let y = ['üòÑ', 'üò∏', 'üòÉ', 'üòÖ', 'ü•∞', 'üòà', '‚ò†Ô∏è', 'üëæ', 'üò≤', 'üòõ', 'üôÅ', 'üòú']
  let z = ['üòÑ', 'üò∏', 'üòÉ', 'üòÖ', 'ü•∞', 'üòà', '‚ò†Ô∏è', 'üëæ', 'üò≤', 'üòõ', 'üôÅ', 'üòú']
  let a;
  let b;
  let c;


  var lol = Math.floor(Math.random() * 12)



  a = x[lol];
  b = y[lol];
  c = z[lol];

  if (a === b && b === c && a === c) {
    return (
      <>
        <div className="machine">
          <h1 className="heading">welcome to your slote machine</h1>
          <h1 className="span">
            {a} {b} {c}
          </h1>

          <h3>this is maching</h3>

          <hr />
        </div>

      </>
    )
  }
  else {

    return (
      <>
        <div className="machine">
          <h1 className="heading">welcome to your slote machine</h1>
          <h1 className="span">
            {x} {y} {z}
          </h1>

          <h3>this is not maching</h3>
          <hr />
        </div>

      </>
    )

  }


}



ReactDOM.render(

  <>

    <div className="fle">
      <div className="flex"><Runmachine /></div>
    </div>

  </>, document.getElementById('root')

);
